@hypebeastkicks: @pattanl and @nike have been known for their legendary collaborations such as the  Air Max 1 “Cherrywood,” “Purple Denim,” and “Lucky Green/" Now the duo is back with the Air Max 1 “Noise Aqua.” The usual smoothly shaped mudguard that runs around the lower edge of the shoe is now wavy and curvaceous reminiscent of the Air Max 2 ‘94. An embroidered mini Swoosh decorates the bumper on the lateral side, while the rest of the AM1 looks pretty familiar. Other details include a grey mesh toebox, "Patta" branding on the tongue and the signature multicolored outsole. Stay tuned for more info.⁠
